import React from 'react';

const Header = () => {
    return (
        <nav>
            <div className="nav-wrapper">
                <img src="/logo.png" style={{width:"150px", height:"50px"}} alt="lobinton" className="brand-logo"/>
            </div>
        </nav>
    )
}

export default Header;
